/**
 * 
 */
$(function() {
	
	//$("#menudusite").affix();
	 $("#menudusite").affix({offset: {top: $("#menudusite").outerHeight(true)} });
	
	$("#alt_image").attr('value','data:image/png;base64,');
	if($("#code_utilisateur").val()=="null" || $("#code_utilisateur").val()==""){
		$('.connecte')
		.hide();
$('.deconnecte')
		.show();
	}
	//var element = document.createElement("ul");
	//element.id="r_search";
	// transformecurseur('#option', 'pointer','none');
	/*
	 * on vérifie si un utilisateur est connecté
	 */
	connecte();
	/*
	 * récupération de la date courante du serveur
	 */
	getServerDate("date");

	/*
	 * on refait la vérification toutes les 03 secondes
	 */
	window.setInterval("connecte()", 3000);
	/*
	 * on récupère les projets de l'utilisateur sur le serveur
	 */
	loadprojetuser();
	/*
	 * on rafraichit la liste des projets de l'utilisateur toutes les 01 minutes
	 */
	window.setInterval("loadprojetuser()", 60000);
	
	$('#search').on('focus', function() {
		$('#btn_search').css('background', '#FBAF3F').css('color', '#652C90');
		
	});
	$('#search').on('blur', function() {
		$('#btn_search').css('background', '#652C90').css('color', '#FBAF3F');
		$("#r_search").html("");
	});
	
	/*
	 * touche de déconnexion de l'uttilisateur
	 */
	$('#deconnexion').on('click', function() {
		deconnexion();
		connecte();
	});
	/*
	 * rechercher un projet par son titre dans la barre de recherche
	 */
	$('#search').on('keyup change click', function() {
		if($('#search').val()!=""){
			$
			.ajax({
				type : "post",
				url : "consulterprojetbytitre",
				cache : false,
				data : {titre:$('#search').val()},
				success : function(response) {
					var projet = eval('(' + response + ')');
					var a="";

					
					for ( var id in projet) {
						a+='<li class="li_result"><a  href="projetvue?codeP='+projet[id].codeProjet+'"><div class="link_result">'+projet[id].titre+'</div></a></li>';

					}
					
					$("#r_search").html(a);
					$("#r_search").css('left', $('#search').offset().left);
					$("#r_search").css('width', $('#search').innerWidth());
					$("#r_search").css('top', $('#search').position().top+$('#search').innerHeight());
					//$("#r_search").css('position','rigth');
					},
				error : function() {
					alert('Error while request..');
				}
			});
		}else{
			$("#r_search").html("");
		}
		
	});
});
